import React, { useState } from 'react';
import Slider from 'react-slick'; // Import the Slider component
import '../assets/styles/components-css/women-ministry.css'; // Updated CSS file path

const womenEvents = [
  {
    id: 1,
    title: 'Women Empowerment Seminar',
    date: '2024-10-10',
    description: 'A seminar focusing on empowering women in various aspects of life.',
    location: 'Main Auditorium',
    imageUrl: 'https://via.placeholder.com/400x200',
  },
  {
    id: 2,
    title: 'Motherhood Workshop',
    date: '2024-11-05',
    description: 'A workshop dedicated to addressing the challenges of motherhood.',
    location: 'ZOOM',
    imageUrl: 'https://via.placeholder.com/400x200',
  },
  {
    id: 3,
    title: 'Women in Leadership',
    date: '2024-12-12',
    description: 'Exploring the role of women in leadership within the church.',
    location: 'Church Sanctuary',
    imageUrl: 'https://via.placeholder.com/400x200',
  },
];

const galleryImages = [
  {
    id: 1,
    imageUrl: 'https://via.placeholder.com/600x400',
    alt: 'Women Event 1',
  },
  {
    id: 2,
    imageUrl: 'https://via.placeholder.com/600x400',
    alt: 'Women Event 2',
  },
  {
    id: 3,
    imageUrl: 'https://via.placeholder.com/600x400',
    alt: 'Women Event 3',
  },
];

const WomenMinistry = () => {
  const [modalImage, setModalImage] = useState(null);

  const openModal = (image) => {
    setModalImage(image);
  };

  const closeModal = () => {
    setModalImage(null);
  };

  // Settings for React Slick
  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div className="women-ministry-container">
      {/* Hero Section */}
      <section className="women-hero-section">
        <div className="hero-overlay">
          <h1>Women Ministry</h1>
          <p>Welcome to the Women Ministry.</p>
          <div className="women-ministry-focus-text">
            <p>
              Provides pastoral care and counseling, addressing issues like marriage, child upbringing, and career challenges.
            </p>
          </div>
        </div>
      </section>

      {/* Section Title */}
      <h2 className="women-events-title">Women Ministry Events</h2>

      {/* Events Section */}
      <div className="women-events-scroll-container">
        <button className="arrow-button left">←</button>
        <section className="women-events-list">
          {womenEvents.map((event) => (
            <div key={event.id} className="women-event-card">
              <img src={event.imageUrl} alt={event.title} />
              <h3>{event.title}</h3>
              <p>{event.date}</p>
              <p>{event.description}</p>
              <p>{event.location}</p>
            </div>
          ))}
        </section>
        <button className="arrow-button right">→</button>
      </div>

      {/* Gallery Section */}
      <h2 className="women-gallery-title">Women Ministry Gallery</h2>
      <div className="women-gallery">
        <Slider {...sliderSettings}>
          {galleryImages.map((image) => (
            <div key={image.id} className="gallery-item" onClick={() => openModal(image.imageUrl)}>
              <img src={image.imageUrl} alt={image.alt} className="gallery-thumbnail" />
            </div>
          ))}
        </Slider>
      </div>

      {/* Modal for Full-Sized Image */}
      {modalImage && (
        <div className="modal" onClick={closeModal}>
          <img src={modalImage} alt="Full-size gallery" className="modal-content" />
          <span className="close" onClick={closeModal}>&times;</span>
        </div>
      )}

      {/* Footer Section */}
      <footer className="women-ministry-footer">
        <p>© 2024 Women Ministry. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default WomenMinistry;
